import React from 'react';
import ReactDOM from 'react-dom';
import M from 'materialize-css';
import './index.css';

class Tab extends React.Component {
    render() {
        return (
            <div>
                <li class="tab col s3"><a href="#test1">{this.props.name}</a></li>
            </div>
        );
    }
}

class Container extends React.Component {
    render() {
        return (
            <div class="row div z-depth-5">
                <div class="col s12">
                <ul class="tabs tabs-fixed-width tab-demo z-depth-1">
    <li class="tab"><a href="#test1">Test 1</a></li>
    <li class="tab"><a class="active" href="#test2">Test 2</a></li>
    <li class="tab disabled"><a href="#test3">Disabled Tab</a></li>
    <li class="tab"><a href="#test4">Test 4</a></li>
    <li class="tab"><a href="#test0">Test 5</a></li>
  </ul>
                </div>
            </div>
        );
    }
}

var instance = M.Tabs.init(<Tab />, {swipeable: true});

class NavBar extends React.Component {
    render() {
        return (
            <div>
                <nav>
                    <div class="nav-wrapper pink lighten-3">
                        <a href="#" class="brand-logo center">MatejSwap</a>
                        <ul id="nav-mobile" class="right hide-on-med-and-down">
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }
}

class Page extends React.Component {
    render() {
        return (
            <div>
                <NavBar />
                <Container />
            </div>
        );
    }
}

ReactDOM.render(<Page />, document.getElementById("root"));
